import { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";

function App() {
  const [query, setQuery] = useState("people");
  const getImages = async () => {
    await axios
      .get(`https://api.pexels.com/v1/search?query=${query}`, {
        headers: {
          Authorization: `jUeC6EnmP3bSLZVPFuLzitXzS0kH0aT46zTSrrxT4bSKcG41TDJ4mMMG`,
        },
      })
      .then((res) => console.log(res.data.photos));
  };

  useEffect(() => {
    getImages();
  }, [query]);

  return (
    <div className="App">
      <input />
    </div>
  );
}

export default App;

